import React, { useState } from 'react';
import './AddEnclosureForm.css';

function AddEnclosureForm({ onAddEnclosure }) {
  const [enclosureId, setEnclosureId] = useState('');
  const [name, setName] = useState('');
  const [enclosureType, setEnclosureType] = useState('');
  const [buildDate, setBuildDate] = useState('');
  const [address, setAddress] = useState('');
  const [cleaningStartTime, setCleaningStartTime] = useState('');
  const [cleaningEndTime, setCleaningEndTime] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!validateInputs()) {
      return;
    }

    const newEnclosure = {
      enclosureId,
      name,
      enclosureType,
      buildDate,
      address,
      cleaningStartTime,
      cleaningEndTime,
    };

    onAddEnclosure(newEnclosure);

    // Clear form inputs after submission
    setEnclosureId('');
    setName('');
    setEnclosureType('');
    setBuildDate('');
    setAddress('');
    setCleaningStartTime('');
    setCleaningEndTime('');
  };

  const validateInputs = () => {
    const enclosureIdRegex = /^\d+$/;
    const dateRegex = /^(0?[1-9]|1[0-2])\/(0?[1-9]|[12][0-9]|3[01])\/\d{4}$/;
    const timeRegex = /^(0?[1-9]|1[0-2]):[0-5][0-9] [AP]M$/i;

    if (!enclosureId.match(enclosureIdRegex)) {
      alert('Enclosure ID must be a positive integer.');
      return false;
    }

    if (!buildDate.match(dateRegex)) {
      alert('Build Date must be in format MM/DD/YYYY.');
      return false;
    }

    if (!cleaningStartTime.match(timeRegex)) {
      alert('Cleaning Start Time must be in format HH:MM AM/PM.');
      return false;
    }

    if (!cleaningEndTime.match(timeRegex)) {
      alert('Cleaning End Time must be in format HH:MM AM/PM.');
      return false;
    }

    return true;
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="form-group">
        <label htmlFor="enclosureId">Enclosure ID:</label>
        <input
          type="number"
          id="enclosureId"
          value={enclosureId}
          onChange={(e) => setEnclosureId(e.target.value)}
          min="0"
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="enclosureType">Enclosure Type:</label>
        <input
          type="text"
          id="enclosureType"
          value={enclosureType}
          onChange={(e) => setEnclosureType(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="buildDate">Build Date:</label>
        <input
          type="text"
          id="buildDate"
          value={buildDate}
          onChange={(e) => setBuildDate(e.target.value)}
          placeholder="MM/DD/YYYY"
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="address">Address:</label>
        <input
          type="text"
          id="address"
          value={address}
          onChange={(e) => setAddress(e.target.value)}
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="cleaningStartTime">Cleaning Start Time:</label>
        <input
          type="text"
          id="cleaningStartTime"
          value={cleaningStartTime}
          onChange={(e) => setCleaningStartTime(e.target.value)}
          placeholder="HH:MM AM/PM"
          required
        />
      </div>
      <div className="form-group">
        <label htmlFor="cleaningEndTime">Cleaning End Time:</label>
        <input
          type="text"
          id="cleaningEndTime"
          value={cleaningEndTime}
          onChange={(e) => setCleaningEndTime(e.target.value)}
          placeholder="HH:MM AM/PM"
          required
        />
      </div>
      <button type="submit">Add Enclosure</button>
    </form>
  );
}

export default AddEnclosureForm;
